import React from 'react';
import "../Asserts/Css/Pages/refusedapplication.css";
import Header from '../Components/header';
import Footer from '../Components/footer';
import Navbar from '../Components/navbar';
import StudyAbroad from '../Components/StudyAbroad';
import YourNextStep from '../Components/YourNextStep';


const RefusedApplication = ()=>{
    return (
          <div className='refusedapplicationpage'>
              <Header></Header>
              <Navbar></Navbar>
              <StudyAbroad></StudyAbroad>
             <h1>Why does an application get refused?</h1>
             <h2>Visa applications are normally declined due to the following reasons:
</h2>


<YourNextStep></YourNextStep>
           <Footer></Footer>
              </div>
    )
}

export default RefusedApplication  ;
